        #region Private Methods

        private void btnSprungMonatsBudget_Click(object sender, System.EventArgs e)
        {
            if (!DBUtil.IsEmpty(qryQuery["BudgetID"]))
            {
                SqlQuery qrytemp = DBUtil.OpenSQL(@"
                    SELECT FAL.BaPersonID, FLE.ModulID, BFP.BgFinanzplanID
                    FROM BgBudget              BBG
                      INNER JOIN BgFinanzplan  BFP ON BFP.BgFinanzplanID = BBG.BgFinanzplanID
                      INNER JOIN FaLeistung    FLE ON FLE.FaLeistungID = BFP.FaLeistungID
                      INNER JOIN FaFall        FAL ON FAL.FaFallID = FLE.FaFallID
                    WHERE BBG.BgBudgetID = {0}",
                    qryQuery["BudgetID"]);

                if (qrytemp.Count == 1)
                {
                    string jumpToPath = string.Format(
                        "ClassName=FrmFall;BaPersonID={0};ModulID={1};TreeNodeID=CtlWhFinanzplan{2}\\BBG{3}",
                        qrytemp["BaPersonID"],
                        qrytemp["ModulID"],
                        qrytemp["BgFinanzplanID"],
                        qryQuery["BudgetID"]);

                    System.Collections.Specialized.HybridDictionary dic = FormController.ConvertToDictionary(jumpToPath);
                    bool result = FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
                }
            }
        }

        private void kissButton1_Click(object sender, System.EventArgs e)
        {
            try
            {
                Cursor.Current = Cursors.WaitCursor;
                KiSS4.FAMOZ.PSCDServices.PSCDInterface.NotifyAboutSAPDataReady("AUSGLEICH_LEICHEN", 1);
                Cursor.Current = Cursors.Default;
                KissMsg.ShowInfo("Die Einträge wurden erneut verarbeitet. Klicken Sie auf 'OK' um die Liste zu aktualisieren.");
                qryQuery.Refresh();
            }
            catch(Exception ex)
            {
                KissMsg.ShowInfo("Fehler: " + ex.Message);
                return;
            }
        }

        private void qryQuery_PositionChanged(object sender, System.EventArgs e)
        {
            btnSprungMonatsBudget.Enabled = !DBUtil.IsEmpty(qryQuery["BudgetID"]);
        }

